import './App.css';
import { RouterProvider, createBrowserRouter } from 'react-router-dom'
import Home from './home/Home.js';
import Map from './map/Map'

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />
  },

  {
    path: "/map",
    element: <Map />
  },
])



function App() {
  return (
    <div className="App">
      <RouterProvider router={router} />

      {/* <Home /> */}

      {/* <Map /> */}





    </div>
  );
}

export default App;
